import axiosClient from './AxiosClient';

const usersApi = {
  // Get all users
  getAll: () => axiosClient.get('/users'),

  // Delete all users (json-server does not support delete all directly)
  // We'll simulate it later
  deleteAll: () => Promise.reject('Not supported in json-server'),

  // Order by age (json-server supports query parameters)
  getOrderedByAge: () => axiosClient.get('/users?_sort=age&_order=asc'),

  // Delete by id
  deleteById: (id) => axiosClient.delete(`/users/${id}`),

  // Add new user
  add: (data) => axiosClient.post('/users', data),

  // Update user
  update: (id, data) => axiosClient.put(`/users/${id}`, data),

  // json-server does not support file uploads
  addWithImage: (formData) => Promise.reject('Not supported in json-server'),
};

export default usersApi;
